// import './App.css';

import './styling/styles.css'

function App() {
  return (
    <div className="App">
      <nav className="navbar">
        <a href="/" id="site-title">Movie App</a>
        <a href="/" id="home">Home</a>
        <a href="/" id="instructions">Instructions</a>
      </nav>
      <h1>All your movie commitment issues solved!</h1>
    </div>
  );
}

export default App;
